                download="resume.pdf">
                Download
            </a>
            <div className="d-flex flex-wrap resumeImg">
                <img src="./images/resumeimg.png" alt="resume" className="mx-auto py-auto" />
                {/* </div> */}

            </div>

        </Container >
    )
}
